const Dummy_Event = [
    {id: 1, title: 'Dummy1'},
    {id: 2, title: 'Dummy2'},
    {id: 3, title: 'Dummy3'},
    {id: 4, title: 'Dummy4'},
]



function EventPage (){
    return(
        <>
        <h1>EventPage</h1>
        {Dummy_Event.map((prod) => (
            <EventDetailPage> </EventDetailPage>
        ))}
        </>
    )
}

export default EventPage;
